لإنشاء تطبيق Flutter يعمل كواجهة دردشة (Chat) مع الذكاء الاصطناعي باستخدام OpenRouter API، إليك نموذج بسيط لكيفية إعداد مشروع Flutter والاتصال بـ OpenRouter API. سأقوم بتزويدك بالكود الأساسي لبدء المشروع.

### الخطوات الأساسية:

1. **إنشاء مشروع Flutter جديد:**
   افتح Terminal أو Command Prompt واستخدم الأمر التالي:
   ```bash
   flutter create chat_ai_app
   cd chat_ai_app
   ```

2. **تعديل ملف `pubspec.yaml`:**
   أضف الحزم المطلوبة، مثل `http` للتعامل مع طلبات HTTP.
   ```yaml
   dependencies:
     flutter:
       sdk: flutter
     http: ^0.13.3
   ```

   ثم قم بتشغيل الأمر التالي لتثبيت الحزم:
   ```bash
   flutter pub get
   ```

3. **إنشاء واجهة المستخدم:**
   افتح ملف `lib/main.dart` واستبدل محتوياته بالكود التالي:

```dart
import 'package:flutter/material.dart';
import 'package:http/http.dart' as http;
import 'dart:convert';

void main() {
  runApp(ChatAIApp());
}

class ChatAIApp extends StatelessWidget {
  @override
  Widget build(BuildContext context) {
    return MaterialApp(
      title: 'Chat with AI',
      home: ChatScreen(),
    );
  }
}

class ChatScreen extends StatefulWidget {
  @override
  _ChatScreenState createState() => _ChatScreenState();
}

class _ChatScreenState extends State<ChatScreen> {
  final TextEditingController _controller = TextEditingController();
  List<String> messages = [];

  Future<void> sendMessage(String message) async {
    setState(() {
      messages.add(message);
    });

    final response = await http.post(
      Uri.parse('https://api.openrouter.ai/v1/chat'), // استبدل هذا بالرابط الصحيح لـ OpenRouter API
      headers: {'Content-Type': 'application/json'},
      body: json.encode({'message': message}),
    );

    if (response.statusCode == 200) {
      var data = json.decode(response.body);
      setState(() {
        messages.add(data['response']); // تأكد من تعديل هذا بناءً على بنية رد API
      });
    } else {
      setState(() {
        messages.add('Error: ${response.statusCode}');
      });
    }

    _controller.clear();
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: Text('Chat with AI'),
      ),
      body: Column(
        children: [
          Expanded(
            child: ListView.builder(
              itemCount: messages.length,
              itemBuilder: (context, index) {
                return ListTile(
                  title: Text(messages[index]),
                );
              },
            ),
          ),
          Padding(
            padding: const EdgeInsets.all(8.0),
            child: Row(
              children: [
                Expanded(
                  child: TextField(
                    controller: _controller,
                    decoration: InputDecoration(
                      labelText: 'Send a message',
                    ),
                  ),
                ),
                IconButton(
                  icon: Icon(Icons.send),
                  onPressed: () {
                    if (_controller.text.isNotEmpty) {
                      sendMessage(_controller.text);
                    }
                  },
                )
              ],
            ),
          )
        ],
      ),
    );
  }
}
```

### شرح الكود:

- **واجهة المستخدم:** يحتوي على `AppBar` و`ListView` لعرض الرسائل، و`TextField` لإدخال الرسالة.
- **sendMessage:** دالة ترسل الرسالة إلى OpenRouter API وتضيف الرد إلى قائمة الرسائل.
- **http.post:** يقوم بإرسال طلب POST إلى OpenRouter API.

### تشغيل التطبيق:
لتشغيل التطبيق، استخدم الأمر التالي في Terminal:
```bash
flutter run
```

### ملاحظات:
- تأكد من استبدال رابط `https://api.openrouter.ai/v1/chat` بالرابط الصحيح لـ OpenRouter API.
- تحقق من بنية الرد من API لضمان معالجة البيانات بشكل صحيح.

بهذا الشكل، يمكنك البدء في إنشاء تطبيق دردشة باستخدام Flutter و OpenRouter API. يمكنك تحسين واجهة المستخدم وإضافة ميزات إضافية حسب الحاجة.
